import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <a
          className="App-link"
          href="*"
          target="_blank"
          rel="noopener noreferrer"
        >
          Unlayoff - Get found, always!!!
        </a>
      </header>
    </div>
  );
}

export default App;
